import * as actionTypes from '../actions';

const initialState = {
    total: 1,
    operation: 1,
    next: 1
};

const reducer = (state = initialState, action: any) => {
    switch (action.type) {
        case actionTypes.AC:
            return {
                ...state,
                total: 2,
                next: 2,
                operation: 2
            }
    }
    return state
};

export default reducer
